import React,{ useState } from 'react';
import movies from '../movies'
import Movie from './Movie'

function Products(){
  
     return (
        <>
        
        <div className="movie-container">
         <label>Select Time</label>
         <select  id="movie">
           <option value="220">10:30 A.M</option>
           <option value="320">2:00 P.M</option>
           <option value="250">6:00 P.M</option>
           <option value="230">9:00 P.M</option>
         </select>
       </div>
      <div className="countries-container">
      {movies.map((data)=> 
         
         <Movie 
           id={data.id}
           year={data.year}
           title={data.title}
           poster={data.poster}
           genre={data.genre}
         />
        )}</div>
        
        </>
     )
}

export default Products;
